import React from "react";
import { Chart } from "react-google-charts";

const Home = () => {
    const data = [
        ["Task", "Hours per Day"],
        ["Pending", 11],
        ["Completed", 2] // CSS-style declaration
    ];

    const options = {
        title: "Todo Tasks",
        pieHole: 0.3,
        is3D: false,
    };

    return (
        <div>
            <h1>Home</h1>
            <section>
                <Chart
                    chartType="PieChart"
                    width="100%"
                    // height="600px"
                    data={data}
                    options={options}
                />

            </section>
        </div>
    );
}

export default Home;
